%hive
alter table pitem add partition (name='bolt');
alter table pitem add partition (name='screw');
alter table pitem add partition (name='nut');

%hive
insert into table pitem partition (name='bolt') 
    select code, brand, price from item where name='bolt';

insert into table pitem partition (name='screw') 
    select code, brand, price from item where name='screw';

insert into table pitem partition (name='nut') 
    select code, brand, price from item where name='nut';

%hive
set hive.exec.dynamic.partition.mode=nonstrict;

set hive.exec.max.dynamic.partitions=5;

insert overwrite table ppitem partition(name)
    select code, brand, price, name
    from item;

%hive
show partitions ppitem;
select * from ppitem;

%hive
explain extended 
    select * from bitem where name='bolt';

%hive
import table imported_item 
    from '/user/bigdata/exp-item';

select * from imported_item;
